package p3714

import "testing"

func Test_longestBalanced(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name string
		args args
		want int
	}{
		{"Example 1", args{s: "abbac"}, 4},
		{"Example 2", args{s: "aabcc"}, 3},
		{"Example 3", args{s: "aba"}, 2},
		{"My 1", args{s: "abcabbac"}, 6},
		{"My 2", args{s: "acbabbac"}, 4},
		{"TestCase 873", args{s: "aa"}, 2},
		{"TestCase 937", args{s: "abcbc"}, 4},
		{"TestCase 948", args{s: "ac"}, 2},
		{"TestCase 986", args{s: ""}, 15828},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := longestBalanced(tt.args.s); got != tt.want {
				t.Errorf("longestBalanced() = %v, want %v", got, tt.want)
			}
		})
	}
}
